import React from 'react';
import img1 from './assets/bulboff.gif';
import img2 from './assets/bulbon.gif';

function Bulb() {

    let bulbOn = new Image();
    bulbOn.src = "./assets/bulbon.gif";
    
    let bulbOff = new Image();
    bulbOff.src = "./assets/bulboff.gif";
    return (
        <div className='main'>
            <button onClick={bulbOn}>Turn On</button>
            <img src={img1} alt='bulb'/>
            <button onClick={bulbOff}>Turn Off</button>
        </div>
    )
}

export default Bulb;
